    false,nt"url": null,nt"notes": "This dataset is a single centerline highway
    network representation of the 10,000 miles Kansas State Highway System (Interstate,
    U.S., and Kansas routes). The state highway system is a portion of KDOT's All Roads
    Network. The All Roads network, which includes both and state system and non-state
    system single centerline road networks, is mutually exclusive, and can be combined
    into one layer. Network graphics are not true representations of scaled mileages
    for road segments. Mileages are adjusted, via an attribute table, to allow for traveled
    distance which considers changes in elevation.",nt"license_title": null,nt"extras":
